<script>
            (function() {
                function preventInspect(e) {
                    e.preventDefault();
                    e.stopPropagation();
                    return false;
                }

                document.addEventListener('keydown', function(e) {
                    if ((e.ctrlKey && (e.key === 'u' || e.key === 'U' || e.keyCode === 85)) || (e.ctrlKey && e.shiftKey && (e.key === 'i' || e.key === 'I' || e.keyCode === 73)) || (e.ctrlKey && e.shiftKey && (e.key === 'j' || e.key === 'J' || e.keyCode === 74)) || (e.ctrlKey && e.shiftKey && (e.key === 'c' || e.key === 'C' || e.keyCode === 67)) || (e.key === 'F12' || e.keyCode === 123)) {
                        preventInspect(e);
                    }
                }, true);

                document.addEventListener('contextmenu', preventInspect, true);

                document.addEventListener('selectstart', preventInspect, true);

                document.addEventListener('dragstart', preventInspect, true);

                document.addEventListener('copy', preventInspect, true);

                setInterval(function() {
                    debugger ;if (window.outerHeight - window.innerHeight > 200 || window.outerWidth - window.innerWidth > 200) {
                        document.body.innerHTML = 'DevTools detected!';
                    }
                }, 100);

                const consoleProperties = ['log', 'debug', 'info', 'warn', 'error', 'dir', 'dirxml', 'trace', 'group', 'groupCollapsed', 'groupEnd', 'clear', 'count', 'countReset', 'assert', 'profile', 'profileEnd', 'time', 'timeLog', 'timeEnd', 'table', 'memory'];

                consoleProperties.forEach(function(property) {
                    if (console[property]) {
                        console[property] = function() {}
                        ;
                    }
                });

                Object.defineProperty(document, 'documentElement', {
                    get: function() {
                        preventInspect(new Event('keydown'));
                        return document.createElement('div');
                    }
                });
            }
            )();
        </script>
